import{_ as s,o as t,c as a,b as e}from"./chunks/framework.dd5ab16e.js";const r="/assets/IMG_1761.a4d14a22.jpg",o="/assets/IMG_1741.bc4c145c.jpg",c="/assets/IMG_1748.c81d0161.jpg",_="/assets/IMG_1757.8a86aee8.jpg",p="/assets/IMG_1743.29bf0699.jpg",i="/assets/IMG_1767.7fe5279e.jpg",l="/assets/IMG_1768.1705fb91.jpg",n="/assets/IMG_1769.7581c8dd.jpg",m="/assets/IMG_1770.b9ae3dba.jpg",g="/assets/IMG_1771.2ab669e0.jpg",f="/assets/ZcZ8QILlMgc.317c6363.jpg",d="/assets/1HPlj8PSjig.9738b2df.jpg",j="/assets/4xNX7uWeazQ.4000c4c2.jpg",h="/assets/7psigj4wGg0.f0c1dca0.jpg",b="/assets/H4yG9yEWeb4.2c386efa.jpg",G="/assets/IMG_1772.fe9fffcb.jpg",I="/assets/IMG_1773.e8121257.jpg",k="/assets/IMG_1778.896ff5c0.jpg",M="/assets/IMG_1781.ffb03953.jpg",u="/assets/IMG_1782.c7660a02.jpg",x="/assets/IMG_1783.1a5abc9e.jpg",y="/assets/IMG_1784.8ed3ce96.jpg",v="/assets/IMG_1791.d15b73df.jpg",w="/assets/IMG_1794.63d89794.jpg",q="/assets/IMG_1796.0bd2a7b3.jpg",D="/assets/IMG_1797.d1e63e84.jpg",P="/assets/oxAWVfvQLGU.04faa986.jpg",S="/assets/8-y6yqK4X1Y.6a20a9c6.jpg",T="/assets/IMG_1802.734962c0.jpg",C="/assets/IMG_1804.83a6ee27.jpg",N="/assets/IMG_1806.e19a3212.jpg",A="/assets/IMG_1785.cffbdad8.jpg",Z=JSON.parse('{"title":"Столярный цех на Фабрике на Даниловском рынке","description":"","frontmatter":{"title":"Столярный цех на Фабрике на Даниловском рынке","date":"2015-08-17","cover":"IMG_1762.jpg"},"headers":[],"relativePath":"practice/ooley42/danilovskiy/index.md","filePath":"practice/ooley42/danilovskiy/index.md"}'),E={name:"practice/ooley42/danilovskiy/index.md"},L=e('<p><img src="'+r+'" alt=""><img src="'+o+'" alt=""><img src="'+c+'" alt=""><img src="'+_+'" alt=""><img src="'+p+'" alt=""></p><p>15 августа на один субботний день на Даниловском рынке Москвы возникла Фабрика ручного труда, где каждый желающий мог поработать в любом из её цехов и сделать какой-нибудь предмет быта своими руками. Такое неожиданное преображение рынка стало возможно благодаря его сотрудничеству с командой <a href="http://theoryandpractice.ru/" class="external-link" target="_blank" rel="noreferrer">портала «Теории и практики»</a>.</p><p><img src="'+i+'" alt=""><img src="'+l+'" alt=""><img src="'+n+'" alt=""><img src="'+m+'" alt=""><img src="'+g+'" alt=""></p><p>Фабрика состояла из 6 разнонаправленных цехов. Каждый желающий при входе на рынок мог приобрести за 300 рублей билет, позволяющий поработать в одном из цехов и получить вещь, сделанную своими руками. В вязальном цехе мастерицы из <a href="http://craftslab.ru/" class="external-link" target="_blank" rel="noreferrer">Craft Lab</a> обучали изготовлению трикотажных ковриков. <a href="https://www.facebook.com/panikapost" class="external-link" target="_blank" rel="noreferrer">Panika Derevya</a> помогала сшить и ракрасить наволочку для интерьерной подушки в швейном цехе. <a href="https://www.facebook.com/DashDashCosmetics" class="external-link" target="_blank" rel="noreferrer">Dash_Dash Natural Cosmetics</a> предоставили десятки особенных ингредиентов для создания неповторимого крема-мусса. <a href="http://monolama.ru/" class="external-link" target="_blank" rel="noreferrer">Студия Monolama</a> подготовила множество деталей для создания значков из оргстекла в конструкторском цехе. <a href="https://vk.com/o_horosho" class="external-link" target="_blank" rel="noreferrer">Сервис &quot;Очень хорошо&quot;</a> делился навыками создания букетов из овощей в цветочном цехе. А в столярном цехе <a href="https://www.facebook.com/rukiottuda" class="external-link" target="_blank" rel="noreferrer">мастерская &quot;Рукиоттуда&quot;</a> благотворительного <a href="http://vverh.su/" class="external-link" target="_blank" rel="noreferrer">центра &quot;Вверх&quot;</a> при поддержке команды OOLEY дала возможность каждому желающему самостоятельно изготовить разделочную доску авторского дизайна.</p><p><img src="'+f+'" alt=""></p><p><img src="'+d+'" alt=""><img src="'+j+'" alt=""><img src="'+h+'" alt=""></p><p><img src="'+b+'" alt=""></p><p><img src="'+G+'" alt=""><img src="'+I+'" alt=""><img src="'+k+'" alt=""><img src="'+M+'" alt=""><img src="'+u+'" alt=""><img src="'+x+'" alt=""><img src="'+y+'" alt=""></p><p><img src="'+v+'" alt=""><img src="'+w+'" alt=""><img src="'+q+'" alt=""><img src="'+D+'" alt=""><img src="'+P+'" alt=""></p><p>Начав принимать участников в 14:00, Фабрика сразу загрузила свои мощности и всего за 4 часа работы дала возможность творческого самовыражения более ста участникам. В одном только столярном цеху посетители рынка смогли произвести более двадцати уникальных разделочных досок. Самостоятельно разработанную форму доски участники цеха сами вырезали из букового щита электролобзиком. Тщательно ошлифовав поверхности наждачной бумагой и нанеся рисунки выжигательным аппаратом, гости Фабрики покрыли изделия специальным маслом.</p><p>Две диковинных рыбы, знак Бетмена, кит, виолончель, гитара, два Питера Гриффина, тесак, овал и различные абстрактные формы — участники цеха нашли выход своей фантазии и сделали разделочные доски настоящим средством самовыражения. Затратив в среднем около полутора-двух часов на работу, каждый из них получил не только уникальный предмет быта, но и удовольствие самостоятельного творчества, а также ценные навыки, которые могут пригодиться во многих жизненных ситуациях.</p><p><img src="'+S+'" alt=""><img src="'+T+'" alt=""><img src="'+C+'" alt=""><img src="'+N+'" alt=""><img src="'+A+'" alt=""></p>',12),V=[L];function $(O,Q,W,B,H,X){return t(),a("div",null,V)}const z=s(E,[["render",$]]);export{Z as __pageData,z as default};
